import { createApp } from "vue";
import App from "./App.vue";
import router from './Router'
import { createPinia } from 'pinia'
const pinia = createPinia()
var app = createApp(App);
app.config.globalProperties.urlName ='http://admindeal.com.bd/';
// app.prototype.urlName = 'http://admindeal.com.bd/';
window.urlName="http://admindeal.com.bd/";
app.use(router);
app.use(pinia);
app.mount("#app");
